/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"container-fluid py-5 bg-light bg-primary bg-image\" style=\"height: 350px\">\r\n\r\n</div>\r\n\r\n<div class=\"container-fluid py-5 text-black-50\">\r\n  <div class=\"container\" style=\"opacity: 1.0\">\r\n    <div class=\"row\">\r\n      <div class=\"col-12 mx-auto p-5\">\r\n        <h1 class=\"text-center\">Get Start your Online Business with Easy 3 Steps</h1>\r\n        <h3 class=\"text-center\">Become a part of digital economy</h3>\r\n      </div>\r\n    </div>\r\n    <div class=\"row\">\r\n      <div class=\"col-3\"></div>\r\n      <div class=\"col-3\">\r\n        <button class=\"btn btn-block btn-lg btn-primary\" routerLink=\"/manage/register\">Signup</button>\r\n      </div>\r\n      <div class=\"col-3\">\r\n        <button class=\"btn btn-block btn-lg btn-outline-primary\" routerLink=\"/manage/login\">Login</button>\r\n      </div>\r\n      <div class=\"col-3\"></div>\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"container mt-5\">\r\n\r\n  <section>\r\n\r\n    <div class=\"container text-black-50\">\r\n\r\n      <div class=\"text-center pt-3\">\r\n        <h3>BECOME A SUCCESSFUL SELLER IN 3 STEPS</h3>\r\n      </div>\r\n\r\n\r\n      <div class=\"row py-5\">\r\n        <div class=\"col-2\"></div>\r\n        <div class=\"col-8\">\r\n          <div class=\"float-left\">\r\n            <h6>Step 1</h6>\r\n            <h5>REGISTER AND LIST YOUR PRODUCTS</h5>\r\n            <p>-Fill the sign-up form with details about yourself\r\n              <br>\r\n              -Download the seller center app or log in with your credentials\r\n              <br>\r\n              -List your products by providing all relevant information</p>\r\n          </div>\r\n          <div class=\"float-right\">\r\n            <h6>Step 2</h6>\r\n            <h5>RECEIVE ORDERS AND SELL ACROSS PAKISTAN</h5>\r\n            <p>-Start selling once products are listed\r\n              <br>\r\n              -Receive orders and manage them through seller center\r\n              <br>\r\n              -On receiving orders, simply package the order and leave the worry to us</p>\r\n          </div>\r\n          <div class=\"float-left\">\r\n            <h6>Step 3</h6>\r\n            <h5>GET PAYMENTS AND GROW YOUR BUSINESS</h5>\r\n            <p>-Receive payments directly in your account\r\n              <br>\r\n              -Expand your business\r\n              <br>\r\n              -List your products by providing all relevant information</p>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-2\"></div>\r\n      </div>\r\n\r\n      <div class=\"row\" >\r\n        <div class=\"col text-center\">\r\n          <h3>FEATHERS AND BENEFITS</h3>\r\n        </div>\r\n      </div>\r\n\r\n    </div>\r\n  </section>\r\n\r\n  <section>\r\n\r\n    <h4 class=\"mt-3 text-black-50\">OneMall Shopping Center in Pakistan</h4>\r\n    <p class=\"text-black-50\">\r\n      As millions of people want to enter the digital business environment globally. The Tendency to start an online business increases day by day in Pakistan.Â Â \r\n      Now, mostly people showingÂ  interestÂ  in different ways of starting a small online business at International Level. OneMall is known to be the best online selling Platform in Pakistan. If you want to start Own Business with a reliable organization to back you, then OneMall seller center is the best way to go about it. For this, you should register your-self on the OneMall website and start selling. The registration process is easy and simple, so do it now!\r\n    </p>\r\n\r\n    <h4 class=\"mt-3 text-black-50\">OneMall Online Seller</h4>\r\n    <p class=\"text-black-50\">\r\n      If you want to become a part of online Business, now it is not a big deal because OneMall provides you an easy and quick way to start your business in just a few minutes. Once you register yourself on the OneMall seller center account, Congratulations, receive hundreds of orders and get payments.\r\n      But if you are confused about the procedure of how to sell on OneMall, donât worry, we are here to help you.\r\n      There are three easy steps to register yourself on OneMall. Firstly_ Register and list your products, secondly; Receive orders, deliver them and get payments. Now, the time to boost up your sales all over Pakistan. To get more details, Log on to OneMall website and review the Sell-on OneMall page thoroughly.Â \r\n      <br><b>Is it possible to sell their products in OneMall? Surely!</b><br>\r\n      By registering on the OneMall, you can achieve thousands of customers daily and millions yearly. Moreover, OneMall helps you as well as to expand your business at national level by providing reliable shipping, no listing charges, faster, secure & timely payments and much more!Â \r\n      Now, it is the best time to download the OneMall APP, register yourself and begin their journey as an online seller in Pakistan!!!Â \r\n    </p>\r\n\r\n    <h4 class=\"mt-3 text-black-50\">OneMall Marketplace Benefits for Seller</h4>\r\n    <p class=\"text-black-50\">\r\n      The OneMall shopping center provides a variety of items in all categories. You can choose according to your needs. The people who visit the OneMall website, they can search their favorite item through catalog and pick the right one. OneMall ensures that it will provide high-quality products with affordable prices.Â \r\n      The OneMall shopping website offers timely delivery, return/exchange policy, with high-security of payments. In addition, these features make OneMall a reliable and trustworthy platform for millions of customers.\r\n      Now, you should download the OneMall app and get access to millions of products at one roof with discounts, deals and more.\r\n      </p>\r\n\r\n\r\n  </section>\r\n\r\n\r\n  <section>\r\n\r\n    <h4 class=\"mt-3 text-black-50\">Seller FAQ</h4>\r\n\r\n    <div class=\"accordion\" id=\"accordionExample\">\r\n      <div class=\"card\">\r\n        <div class=\"card-header\" id=\"headingOne\">\r\n          <h2 class=\"mb-0\">\r\n            <button class=\"btn btn-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n              How can I open my shop on OneMall?\r\n            </button>\r\n          </h2>\r\n        </div>\r\n\r\n        <div id=\"collapseOne\" class=\"collapse show\" aria-labelledby=\"headingOne\" data-parent=\"#accordionExample\">\r\n          <div class=\"card-body\">\r\n            Just, download the OneMall app and go to the seller center, after this register yourself with easy three steps and start to sell in Pakistan.\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card\">\r\n        <div class=\"card-header\" id=\"headingTwo\">\r\n          <h2 class=\"mb-0\">\r\n            <button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n              How does OneMall work in Pakistan?\r\n            </button>\r\n          </h2>\r\n        </div>\r\n        <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordionExample\">\r\n          <div class=\"card-body\">\r\n            OneMall Seller Center is a place made specifically for OneMall Sellers where you can receive orders and sell across Pakistan. But for this, first register yourself and products then upload them on OneMall online Shopping Station. You will receive your payments directly into your account safely.\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card\">\r\n        <div class=\"card-header\" id=\"headingThree\">\r\n          <h2 class=\"mb-0\">\r\n            <button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n              How much commission deducted by the OneMall?\r\n            </button>\r\n          </h2>\r\n        </div>\r\n        <div id=\"collapseThree\" class=\"collapse\" aria-labelledby=\"headingThree\" data-parent=\"#accordionExample\">\r\n          <div class=\"card-body\">\r\n            OneMall deducts a very minor percentage of commission from the payment of your orders. The commission depends on the type of product and its category.\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"card\">\r\n        <div class=\"card-header\" id=\"headingFour\">\r\n          <h2 class=\"mb-0\">\r\n            <button class=\"btn btn-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseFour\">\r\n              Is it worth it to sell products online through OneMall?\r\n            </button>\r\n          </h2>\r\n        </div>\r\n        <div id=\"collapseFour\" class=\"collapse\" aria-labelledby=\"headingFour\" data-parent=\"#accordionExample\">\r\n          <div class=\"card-body\">OneMall seller account gives you access to millions of customers for your products. In addition, OneMall helps your business by assisting with fast and reliable shipping, professional services & secure and timely payment.\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </section>\r\n\r\n</div>\r\n");

